  entities:
  - uid: 924
    components:
    - type: Transform
      pos: -6.7321386,0.62515736
      parent: 1
    - type: Paper
      content: >-
        This will be my last message.


        I have been captured, they broke through the barricades I made and ive been taken into one of their holding cells. The medical borg took my cellmate. Heard screaming and that accursed saw buzzing a moment later.


        Another borg has appeared. Sparkling new and straight off the assembly line, doesnt take much imagination to figure out where they got the brain... I think im next.



        Heard some lound banging on the walls. Borgs are in a frenzy, I can only hope rescue is coming.
    - type: Physics
      angularDamping: 0
      linearDamping: 0
  - uid: 925
    components:
    - type: Transform
      pos: 10.489922,-4.6147537
      parent: 1
    - type: Paper
      content: >-
        Something went wrong. The project management AI went haywire the moment we landed on this accursed rock. Screaming in that horrid robot tone over our comms. Those of us who were inspecting the leak in the radiation containment quickly found the door was electrified, Barry is in bad condition because of it.


        Luckily there arent any cameras in this room, and we've managed to use what materials we had to fashion a hidden doorway. We hear the telltale whirring of the station's borgs searching outside, and... the screams of the other crew...


        Comms have gone silent, we dont have any food and im worried we might die in here.


        God help us all...
